    "legend": [

            "data": [

                "[C101\u793e\u56e2\u6570]",
                "[\u6c34\u661f\u7684\u9b54\u5973\uff0c\u7b2c19\u8bdd\u300c\u4e00\u756a\u3058\u3083\u306a\u3044\u3084\u308a\u65b9\u300d\uff0c\u6765\u6295\u7968\u5427]",
